namespace App\Services;

class SemanticRouter
{
    public static function route($vectorizedInput)
    {
        $routes = self::getRoutes();
        $highestScore = -1; // Cosine similarity can be 0 to 1, so start with -1
        $selectedRoute = null;

        foreach ($routes as $routeName => $routeVector) {
            $score = self::cosineSimilarity($vectorizedInput, $routeVector);
            if ($score > $highestScore) {
                $highestScore = $score;
                $selectedRoute = $routeName;
            }
        }

        return $selectedRoute; // Return the name of the route with the highest cosine similarity
    }

